import * as React from "react";
import ToggleButton from "@mui/material/ToggleButton";

export function SeenItToggle(props) {
  return (
    <ToggleButton
      value="check"
      selected={props.seenIt}
      onChange={() => {
        props.setSeenIt(!props.seenIt);
      }}
    >
      Hide Watched Movies
    </ToggleButton>
  );
}

export function StreamItToggle(props) {
  return (
    <ToggleButton
      value="check"
      selected={props.streamIt}
      onChange={() => {
        props.setStreamIt(!props.streamIt);
      }}
    >
      Hide Unstreamable
    </ToggleButton>
  );
}
